import React, { useState } from 'react';
import axios from 'axios';

function AddShoeForm() {
  const [brand, setBrand] = useState('');
  const [model, setModel] = useState('');
  const [acquisitionDate, setAcquisitionDate] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // Send form data to the /shoes endpoint
      await axios.post('/shoes', {
        brand,
        model,
        acquisition_date: acquisitionDate // Make sure to match the key with the backend
      });

      // Clear form fields after successful submission
      setBrand('');
      setModel('');
      setAcquisitionDate('');

      // Optionally, you can show a success message or redirect the user
      alert('Shoe added successfully');
    } catch (error) {
      console.error('Error adding shoe:', error);
      // Handle error (e.g., display error message to user)
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="brand">Brand:</label>
      <input type="text" id="brand" value={brand} onChange={(e) => setBrand(e.target.value)} required />
      <br />

      <label htmlFor="model">Model:</label>
      <input type="text" id="model" value={model} onChange={(e) => setModel(e.target.value)} required />
      <br />

      <label htmlFor="acquisitionDate">Acquisition Date:</label>
      <input type="date" id="acquisitionDate" value={acquisitionDate} onChange={(e) => setAcquisitionDate(e.target.value)} required />
      <br />

      <button type="submit">Add Shoe</button>
    </form>
  );
}

export default AddShoeForm;
